import { render } from "react-dom";

class PictureBar extends React.Component {

    constructor(props) {
        super(props);

        this.state = {
            imageList : [
                "https://cdn.homedics.com/media/catalog/product/cache/1/thumbnail/1000x/17f82f742ffe127f42dca9de82fb58b1/m/s/msk-f1.jpg",
                "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSFlHhVX_6NV02EnmlsUSzNB2LBoRhLiX7gtQ&usqp=CAU",
                "https://www.google.com/url?sa=i&url=https%3A%2F%2Fpngtree.com%2Ffreepng%2Fcorona-virus-cartoon-vector-illustration-with-facial-expression_5336379.html&psig=AOvVaw11daMqROR3kFp1Bxb8mg9f&ust=1594128495015000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCOCP2NnduOoCFQAAAAAdAAAAABAD",
                "https://www.google.com/imgres?imgurl=https%3A%2F%2Ficon2.cleanpng.com%2F20180430%2Frcq%2Fkisspng-surgical-mask-respirator-medicine-influenza-surger-cartoon-mascara-5ae698a74b9be3.5138973115250617993097.jpg&imgrefurl=https%3A%2F%2Fwww.cleanpng.com%2Ffree%2Fsurgical-mask.html&tbnid=zvP1hNg0K1vJGM&vet=10CEAQMygeahcKEwjgj9jZ3bjqAhUAAAAAHQAAAAAQCg..i&docid=hK8XYG0-uuFFEM&w=260&h=300&q=funny%20covid%20images%20png&hl=en&ved=0CEAQMygeahcKEwjgj9jZ3bjqAhUAAAAAHQAAAAAQCg",
                "https://www.google.com/imgres?imgurl=https%3A%2F%2Fbargainbathroom.com%2Fwp-content%2Fuploads%2F2020%2F03%2Femptyshelves.png&imgrefurl=https%3A%2F%2Fbargainbathroom.com%2Falternatives-to-toilet-paper%2F&tbnid=Hq5i5YlcSbe9oM&vet=12ahUKEwiBtJ_T3rjqAhVBEFMKHVyRD2AQMygAegQIARB7..i&docid=H3T_ksmJlQW9aM&w=821&h=538&q=empty%20toilet%20paper%20shelves%20png&hl=en&ved=2ahUKEwiBtJ_T3rjqAhVBEFMKHVyRD2AQMygAegQIARB7",
                "https://www.google.com/imgres?imgurl=https%3A%2F%2Fcdn.facilityexecutive.com%2Fwp-content%2Fuploads%2F2020%2F03%2Fworking-from-home-meme-14-300x300-1.jpg&imgrefurl=https%3A%2F%2Ffacilityexecutive.com%2F2020%2F03%2Ffriday-funny-are-we-ready-to-work-from-home%2F&tbnid=H6liO5T71ds9sM&vet=10CG4QMyiaAWoXChMI6M3kh9-46gIVAAAAAB0AAAAAEAI..i&docid=ixCw1Kan_E9gLM&w=300&h=300&q=working%20from%20home%20funny%20png&hl=en&ved=0CG4QMyiaAWoXChMI6M3kh9-46gIVAAAAAB0AAAAAEAI",

            ],
            index: 0
        }
    }



    componentDidMount() {
        this.myTimer();
       }
   
       myTimer = () => {
               if ( this.state.index > 6 ) {
                   console.log("picture index is over 10")
                   this.setState({index:0})
               }
   
   
           setTimeout(
               function() {
                   this.setState({index: this.state.index + 1});
                   console.log("picture index after increase")
                   console.log(this.state.index)
                   this.myTimer();
               }.bind(this), 5000)
       }
   

render() {

    return (
        <div>
            <div>image div</div>
            <img style={{height: "200px", width:"200px"}} src={this.state.imageList[this.state.index]}/>
        </div>
    )
}

}


export default PictureBar;
